package com.brink.model.ui;import com.brink.model.ProjectSummary;import com.brink.model.ableton.AbletonAudioClip;import com.brink.model.ableton.AbletonDevice;import javafx.beans.property.SimpleBooleanProperty;import javafx.beans.property.SimpleStringProperty;import javafx.scene.control.TableColumn;import javafx.scene.control.TableView;import javafx.scene.layout.VBox;import org.slf4j.Logger;import org.slf4j.LoggerFactory;import java.util.List;public class AbletonAudioClipTableView extends VBox {    private static final Logger logger = LoggerFactory.getLogger(AbletonAudioClipTableView.class);    public AbletonAudioClipTableView(List<AbletonAudioClip> abletonAudioClipList) {        setSpacing(12);        setStyle("-fx-padding: 10;");        TableView<AbletonAudioClip> audoClipTable = createAudioClipTable();        audoClipTable.getItems().addAll(abletonAudioClipList);        getChildren().add(audoClipTable);    }    private static TableView<AbletonAudioClip> createAudioClipTable() {        TableView<AbletonAudioClip> table = new TableView<>();        table.setColumnResizePolicy(TableView.CONSTRAINED_RESIZE_POLICY);        TableColumn<AbletonAudioClip, String> nameCol = new TableColumn<>("Name");        nameCol.setCellValueFactory(cellData -> new SimpleStringProperty(cellData.getValue().getName()));        TableColumn<AbletonAudioClip, Boolean> isNativeCol = new TableColumn<>("In project");        isNativeCol.setCellValueFactory(cellData -> new SimpleBooleanProperty(cellData.getValue().isInProject()));        table.getColumns().addAll(nameCol, isNativeCol);        return table;    }}